head.script:
//


			//document.oncontextmenu = function () { return false; };
			var ProgramId = 4;

			function doRefresh() {
				if (appMode) {
					//setButtonState(true);
				}
				else
					setProviderButtonState(true);

				window.location = 'default.aspx' + window.location.search;
			}

			function butSetDesiredGroupAmount_Click() {

				if (butSetDesiredGroupAmountClick(false, 'number of provider(s)')) 
					return true;				
				else
					return false;				
			}

			function butAdjustAmountDesired_Click() {
				if (butSetDesiredGroupAmountClick(true, 'percentage of slot(s)'))
					return true;
				else
					return false;
			}

			function butIncreaseAmountDesired_Click() {
				if (butSetIncreaseAmountClick('number of slot(s)')) 
					return true;
				else
					return false;
			}

			function butApplyForNextXWeeks_Click() {
				if (butApplyForNextXWeeksClick())
					return true;
				else
					return false;
			}

			function butSchedule_Click() {

				if (window.confirm('Are you sure you want to schedule the selected provider(s)?') == false)
					return false;

				//setButtonState(true);

				for (j = document.Form1.lstSelected.options.length - 1; j >= 0; j--)
					document.Form1.lstSelected.options[j].selected = true;

				return true;
			}

			function butRemove_Click() {

				if (window.confirm('Are you sure you want to remove the selected provider(s)?') == false)
					return false;

				//setButtonState(true);

				return true;
			}

			//do this once per load
			$(document).ready(function () {

				//fires when selected
				$($("#selectable")).selectable({

					start: function () {

						//mark cells unselected
						for (i = 0; i < smGrid.smCells.length; i++) {
							if (smGrid.smCells[i].isSelected)
								smGrid.smCells[i].setSelected(false);
						}

						//clear hidden field
						$('#hdSelected').val('');
					},

					stop: function () {
						$(".ui-selected", this).each(function () {

							//get selected item index
							var index = $("#selectable li").index(this);

							//mark cells selected
							for (i = 0; i < smGrid.smCells.length; i++) {

								//same index, not headers and not already selected
								if (smGrid.smCells[i].index == index
									&& smGrid.smCells[i].isHeader == false
										&& smGrid.smCells[i].isSelected == false) {

									smGrid.smCells[i].setSelected(true);
									$('#hdSelected').val($('#hdSelected').val() + smGrid.smCells[i].serialize());
								}
							}
						});

						loadScheduledProvidersFromSelectedCells();
					}
				});

				//window onresize
				$(window).resize(function () {
					if (typeof smGrid != 'undefined')
						smGrid.resize();
				});
			});

			//draws grid every time grid builds
			function drawGrid(isAdmin) {
				//build empty 			
				smGrid = new SMGrid();

				//init with attach to parent and selectable container, it will also auto resize the grid
				smGrid.init($('#divPS'), $("#selectable"), isAdmin);
			}

			//marks cells selected
			function selCells(indx_raw) {

				//
				if (indx_raw == '')
					return;

				var indx_array = new Array();
				indx_array = indx_raw.split(',');
				if (indx_array.length == 0)
					return;

				$('#hdSelected').val('');

				for (i = 0; i < indx_array.length; i++) {
					if (indx_array[i] != '') {						

						//redraw grid's cell
						$("#cell" + indx_array[i]).addClass("ui-selected");

						//IF same index, not headers and not already selected, mark cell filled and serialize for future use						
						for (j = 0; j < smGrid.smCells.length; j++) {
							if (smGrid.smCells[j].specIndex == indx_array[i]
									&& smGrid.smCells[j].isHeader == false
										&& smGrid.smCells[j].isSelected == false) {

								//set cell selected
								smGrid.smCells[j].setSelected(true);
								$('#hdSelected').val($('#hdSelected').val() + smGrid.smCells[j].serialize());
							}
						}

					}
				}

			}

			//fill cells
			function fillCell(backColor, cellIndex, cellText, val_raw) {

				//mark cell filled
				for (i = 0; i < smGrid.smCells.length; i++) {
					if (smGrid.smCells[i].specIndex == cellIndex
							&& smGrid.smCells[i].isHeader == false) {

						var htmlVal;
						var toolTipHtmlVal = '';

						//lets use right css class
						var css_cell_class = 'ui-state-default ';
						if (backColor == FILLED) {
							css_cell_class += 'ui-selecting-finished-FILLED ';
						}
						else if (backColor == UNFILLED) {
							css_cell_class += 'ui-selecting-finished-UNFILLED ';
						}
						else if (backColor == OPERATING) {
							css_cell_class += 'ui-selecting-finished-OPERATING ';
						}
						else if (backColor == NONOPERATING) {
							css_cell_class += 'ui-selecting-finished-NONOPERATING ';
						}
						else if (backColor == INTHEPAST) {
							css_cell_class += 'ui-selecting-finished-INTHEPAST ';
						}

						//store backcolor
						smGrid.smCells[i].backColor = backColor;

						//cells for admins
						if (smGrid.isAdmin) {

							//nothing to be filled
							if (val_raw == null || val_raw == '' || val_raw == 'undefined') {
								//non operational cell
								if (backColor == NONOPERATING)
									htmlVal = "<li class='" + css_cell_class + "' style='CURSOR: pointer;' id='cell" + cellIndex + "'></li>";
							}

							//there are cells that have to be shown filled
							else {

								var cur_cell = smGrid.smCells[i];
								var val_array = new Array();
								var val_l = new Array();
								var val = '';

								val_array = val_raw.split('|');
								for (j = 0; j < val_array.length - 1; j++) {
									val_l = val_array[j].split('*');
									val += "<span style='color:" + val_l[1] + "'>" + val_l[2] + ": " + val_l[3] + "/" + val_l[4] + "</span><br />";
									cur_cell.addProviderGroup(val_l[0], val_l[2], val_l[3], val_l[4]);
								}

								toolTipHtmlVal = "<div class='tooltip' id='image-tooltip" + cellIndex + "'>" + cellText + "<br />" + val + "</div>";

								htmlVal = "<li class='gridcell sel " + css_cell_class + "' id='cell" + cellIndex + "'><dfn id='target" + cellIndex + "' style='color:Black; font-style:normal;'>" + cellText + "</dfn></li>";
								//tooltip functionality
								htmlVal += "<script>$('#target" + cellIndex + "').hover(function () { $('#image-tooltip" + cellIndex + "').show().position({ of: $('#target" + cellIndex + "'), my: 'left bottom', at: 'right top', offset: '-10', collision: 'flip flip' }); }, function () { $('#image-tooltip" + cellIndex + "').hide(); });";
								htmlVal += "</scr";
								htmlVal += "ipt>";
							}

						}

						//cells for providers
						else {							
							htmlVal = "<li class='" + css_cell_class + "' style='CURSOR: pointer;' id='cell" + cellIndex + "'>" + cellText + "</li>";							
						}

						//redraw grid's cell
						$("#cell" + cellIndex).replaceWith(htmlVal);

						$('#CellToolTips').append(toolTipHtmlVal);

						return;
					}
				}
			}

			//fills summary cells
			function fillSumCell(cellIndex, val) {
				//double check on admin
				if (smGrid.isAdmin) {
					//update value
					$("#cellSum" + cellIndex).html(val);
				}
			}


